import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Badges from "../pages/Badges";

function App() {
  return (
    <BrowserRouter>
      <Route path="/badges" component={Badges}></Route>
    </BrowserRouter>
  );
}

export default App;
